import logo from './logo.svg';
import './App.css';
import { Router, Routes, Route } from 'react-router-dom';
import {Home} from './pages';
import {About} from './pages/about'
function Navbar(){
  return(
    <div>
      <p>This is navbar</p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
      </Routes>
</Router>
  );
}

export default App;
